import React from 'react';

const StatePop = props => {
  const loopStates = props.results;
  const loopRes = loopStates.map(st => {
    console.log(st.state);
    return st.state;
  });

  return (
    <div className="state-dropdown">
      <select>{loopRes}</select>
    </div>
  );
};

export default StatePop;
